import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome, faUser, faCog, faQuestion, faImage, faCopy } from '@fortawesome/free-solid-svg-icons';
import { NavItem, NavLink, Nav } from 'reactstrap';
import classNames from 'classnames';
import {Link} from 'react-router-dom';

const SideBar = props => (
    <div Style="background-color: #FF785A;">
      <div>
        <h3>yapyap</h3>
      </div>
      <div className="side-menu">
        <Nav vertical>
          <NavItem>
            <NavLink tag={Link} to={'/'}>
              <FontAwesomeIcon icon={faHome} className="mr-2"/>Home
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink tag={Link} to={'/about'}>
              <FontAwesomeIcon icon={faUser} className="mr-2"/>Account
            </NavLink>
          </NavItem>
          <NavItem>
            <NavLink tag={Link} to={'/about'}>
              <FontAwesomeIcon icon={faCog} className="mr-2"/>Settings
            </NavLink>
          </NavItem>
          {/* Multi-option menu item
          <SubMenu title="Pages" icon={faCopy} items={submenus[1]}/> */}
        </Nav>   
        <h3 ClassName="text-center"> Lifetime Progress </h3>

      </div>
    </div>
  );



export default SideBar;
